import React from 'react';
import { Navigate } from 'react-router-dom';
import { getAuth } from '../auth';

function ProtectedRoute({ role, children }) {
  const user = getAuth();
  return user && user.role === role ? children : <Navigate to="/" />;
}

export default ProtectedRoute;
